column4:
Se um app fica sem uso por alguns meses:

• as permissões são removidas para proteger seus dados;
• as notificações são interrompidas para economizar bateria;
• os arquivos temporários são removidos para liberar espaço.

Para retomar as permissões e notificações, abra o app.
